import React from 'react'

export const Education = () => {
  return (
    <div className='text-[#ffffff] w-full h-screen bg-[black]' >
        <div className='max-w-[1000px] mx-auto flex flex-col' >
            <div>
                <h1 className='text-6xl font-extrabold' >Educational Qualifications</h1>
            </div>
        </div>
    </div>
  )
}
